import React from 'react';
import { UserOutlined} from "@ant-design/icons";

const TaskDistibution = ({user}) => {
    return (
        <div className={"task_distribution"}>
            <UserOutlined/> - {user[0]} : {user[1]}
        </div>
    );
};

export default TaskDistibution;
